const clickNext = (length, stoppped, stores) => {
    console.log(length, stoppped, stores)
    var showIt = [];
    var i;
    if (length >= 3) {
        for (i = stoppped; i < stoppped + 3; i++) {
            showIt[i - stoppped] = stores[i + stoppped];
        }
    }
    else {
        for (i = stoppped; i < length + stoppped; i++) {
            showIt[i - stoppped] = stores[i];
        }
    }
    return showIt;
}
export default clickNext;
